var imgs = [
	'back_none.jpg',
	'p_main',
	'p_barracks',
	'p_stable',
	'p_garage',
	'p_smith',
	'p_place',
	'p_statue',
	'p_market',
	'p_wood',
	'p_stone',
	'p_iron',
	'p_farm',
	'p_storage',
	'p_hide',
	'p_wall',
	'p_snob'
];
var rpls = [
	



'http://rant.se/img/images/ddb5f8.jpg',
	

'data:image/png;base64,',
	

'data:image/png;base64,',
	

'http://rant.se/img/images/97450.png',
	

'http://rant.se/img/images/f7fad.png',
	

'http://rant.se/img/images/f8078.png',
	

'http://rant.se/img/images/ce4fc.png',
	

'http://rant.se/img/images/ccb2b.png',
	

'http://rant.se/img/images/3a5e01.PNG',
	

'http://rant.se/img/images/bf46.png',
	

'http://rant.se/img/images/17cb4.png',
	

'http://rant.se/img/images/53e8.png',
	

'http://rant.se/img/images/9d47.png',
	

'http://rant.se/img/images/01d96c.png',
	

'http://rant.se/img/images/a9ba.png',
	

'http://rant.se/img/images/60c0.png',
	

'http://rant.se/img/images/b16d.png'
]

var imgs_obj = document.getElementsByTagName('IMG');
var back_replaced = false;

for(kk=0; kk<imgs_obj.length; kk++){
	var img_obj = imgs_obj[kk];
	var img_class = img_obj.getAttribute("class");
	if(img_class == "") continue;

	if(!back_replaced && img_obj.getAttribute("height") == 418){
		img_obj.src = rpls[0];
		back_replaced = true;
	}

	for(jj=1; jj<imgs.length; jj++){
		if(img_class == imgs[jj]){
			img_obj.src = rpls[jj];
			break;
		}
	}
}

